import ExpenseItem from "./ExpenseItem";
import items from "../items";
import "./ExpenseItem.css";
import ExpenseFilter from "./ExpensesFilter";

function Expenses() {
  return (
    <div className="expenses">
      <div></div>
      {items.map((expense) => {
        return (
          <ExpenseItem
            date={expense.date}
            title={expense.title}
            amount={expense.amount}
          />
        );
      })}
    </div>
  );
}

export default Expenses;
